package day3;

public class Car
{
public String yearModel; 
public String make; 


public Car(String year, String carMake)

{
yearModel = year;
make = carMake;
}



public Car() {
	// TODO Auto-generated constructor stub
}



public void setYearModel(String y)
{
yearModel = y;
}



public void setMake(String m)
{
make = m;
}

public String getYearModel()
{
return yearModel;
}


public String getMake()
{
return make;
}





}
